let {
    setValue,
    getValue
} = ggbApplet;

let game = {
    rabbitInitialY: -3,
    rabbits: null,
    sounds: null,
    sequence: [1, 3, 5, 7, 9]
}

function ggbOnInit() {
    game.sounds = [note1, note2, note3, note4, note5];
    game.rabbits = Array(5).fill().map((_, i) => new Rabbit(i + 1));
}

function newGame() {
    let operationType = Math.random();

    if (operationType < 0.25) {
        let firstTerm = Math.floor(Math.random() * 10) + 1;
        let increment = Math.floor(Math.random() * 24) + 2;

        game.sequence = game.sequence.map((_, i) => firstTerm + increment * i);
    } else if (operationType < 0.5) {
        let lastTerm = Math.floor(Math.random() * 10) + 1;
        let decrement = Math.floor(Math.random() * 24) + 2;

        game.sequence = game.sequence.map((_, i) => lastTerm + decrement * i)
                                     .reverse();
    } else if (operationType < 0.75) {
        let firstTerm = Math.floor(Math.random() * 10) + 1;
        let multiplier = Math.floor(Math.random() * 2) + 2;

        game.sequence = game.sequence.map((_, i) => firstTerm * multiplier ** i);
    } else {
        let firstTerm = Math.floor(Math.random() * 10) + 1;
        let divisor = Math.floor(Math.random() * 2) + 2;

        game.sequence = game.sequence.map((_, i) => firstTerm * divisor ** i)
                                     .reverse();
    }

    restart();
}

function updateLabels() {
    for (let i = 0; i < game.sequence.length; i++) {
        setValue("num" + (i + 1), i === game.sequence.length - 1 ? undefined : game.sequence[i]);
    }
}

function check() {
    let answer = getValue("answer");

    setValue("num" + game.sequence.length, answer);
    setValue("ok", 3);

    if (answer === game.sequence[game.sequence.length - 1]) win();
    else lose();
}

async function win() { 
    for (let rabbit of game.rabbits) {
        await rabbit.reveal();
    }

    correctSFX.play(); 
    setValue("ok", 1);
}

async function lose() { 
    for (let i = 0; i < game.rabbits.length - 1; i++) {
        await game.rabbits[i].reveal();
    }

    wrongSFX.play(); 
    setValue("ok", 0);
}

function restart() {
    setValue("ok", undefined);
    setValue("answer", undefined);
    updateLabels();

    for (let rabbit of game.rabbits) rabbit.hide();
}

class Rabbit {
    constructor(id) { this.id = id; }

    hide() { setValue("rabbitY" + this.id, game.rabbitInitialY); }

    async reveal() {
        game.sounds[this.id - 1].play();

        for (let i = 1; i < 11; i++) {
            setValue("rabbitY" + this.id, game.rabbitInitialY + i * 0.15)
            await sleep(40);
        }
    }
}

function sleep(ms) { return new Promise(resolve => setTimeout(resolve, ms)); }

let note1 = new Audio("data:audio/mpeg;base64,");
let note2 = new Audio("data:audio/mpeg;base64,");
let note3 = new Audio("data:audio/mpeg;base64,");
let note4 = new Audio("data:audio/mpeg;base64,");
let note5 = new Audio("data:audio/mpeg;base64,");
let wrongSFX = new Audio("data:audio/mpeg;base64,");
let correctSFX = new Audio("data:audio/mpeg;base64,");